script: |
  super -f text -I q10796.spq | sort > q10796.out

inputs:
  - name: q10796.spq
    data: |
      SELECT ALL ( + col1 ) * + + col2 * - + col1 + + col0 + - col1 - col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 5 BETWEEN NULL AND col1;
  - name: tab0

outputs:
  - name: q10796.out
    data: |
      -4
